"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Ankle sprain (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/ankle-sprain-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H4018305\">",
"      <span class=\"h1\">",
"       What happens when a person sprains his or her ankle?",
"      </span>",
"      &nbsp;&mdash;&nbsp;When a person sprains his or her ankle, the ankle joint turns too far in a particular direction. Inside the ankle are tough bands of tissue called ligaments, which hold the different bones together. During a sprain, one or more of those ligaments stretch too far or even tear (",
"      <a class=\"graphic graphic_figure graphicRef83022 \" href=\"mobipreview.htm?9/35/9779\">",
"       figure 1",
"      </a>",
"      ). This can cause pain and swelling, make the ankle unsteady, and make it hard to put weight on the ankle. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4018320\">",
"      <span class=\"h1\">",
"       What are the symptoms of ankle sprain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms can include pain, tenderness, swelling, and bruising at the ankle. Some people with an ankle sprain also find it hard to move the foot in certain directions. Plus, some people cannot put weight on the ankle.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4018335\">",
"      <span class=\"h1\">",
"       Is there a test for ankle sprain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes and no. A doctor or nurse should be able to tell if you have a sprain by doing an exam and learning about what happened to your ankle. He or she might move your foot in different directions to see what hurts and to check how loose your ankle feels.",
"     </p>",
"     <p>",
"      In some cases, a doctor or nurse might order an X-ray to check for broken bones, but that is not always needed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4018350\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You cannot put weight on your ankle",
"       </li>",
"       <li>",
"        Your ankle looks deformed or crooked",
"       </li>",
"       <li>",
"        Your ankle is unstable (for example, it gives out while you are climbing stairs)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      It&rsquo;s also best to see a doctor or nurse if you are not sure how serious an injury is.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4018365\">",
"      <span class=\"h1\">",
"       How is ankle sprain treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment for a sprained ankle is easy to remember if you think of the word &ldquo;RICE.&rdquo; Here&rsquo;s what those letters stand for:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Rest",
"        </strong>",
"        &ndash; To rest the ankle, you can use crutches and stay off your feet.",
"       </li>",
"       <li>",
"        <strong>",
"         Ice",
"        </strong>",
"        &ndash; Apply a cold gel pack, bag of ice, or bag of frozen vegetables on your ankle every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and your skin. Use the ice (or other cold object) for at least 6 hours after your injury. Some people find it helpful to ice longer, even up to 2 days after their injury.",
"       </li>",
"       <li>",
"        <strong>",
"         Compression",
"        </strong>",
"        &ndash; Compression basically means pressure. You want to have your ankle under slight pressure by having it wrapped in an elastic &ldquo;compression&rdquo; bandage. This helps reduce swelling. Your doctor or nurse will show you how to wrap your ankle. It&rsquo;s important that you do not use too much pressure and cut off the blood flow to your foot.",
"       </li>",
"       <li>",
"        <strong>",
"         Elevation",
"        </strong>",
"        &ndash; &ldquo;Elevation&rdquo; means you should keep your foot raised up above the level of your heart. To do this, you can put your foot on some pillows or blankets while you are lying down, or on a table or chair while you are sitting. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You can also take medicines to relieve pain, such as",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      (sample brand name: Tylenol&reg;),",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      (sample brand names: Advil&reg;, Motrin&reg;), or",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?43/35/44597?source=see_link\">",
"       naproxen",
"      </a>",
"      (sample brand name: Aleve&reg;) &nbsp;",
"     </p>",
"     <p>",
"      People who have a mild sprain do not usually need to use a splint to keep their foot and ankle still. But people who have a more severe sprain sometimes do.",
"     </p>",
"     <p>",
"      In rare cases, doctors suggest surgery to repair a torn ligament caused by an ankle sprain.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4018380\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Most people who have had an ankle sprain heal more quickly if they do certain exercises. The right exercises for you will depend on what kind of sprain you have and how severe it is. Ask your doctor which exercises you should do.",
"     </p>",
"     <p>",
"      As time passes, slowly build up the activities you do with your foot and ankle. You might have an easier time doing some activities if you wear a brace or splint on your ankle during your recovery.",
"     </p>",
"    </div>",
