var title_f33_46_34530="Unified Parkinson Disease Rating Scale";
var content_f33_46_34530=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F68974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F68974&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Unified Parkinson Disease Rating Scale",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        The UPDRS is a rating tool to follow the longitudinal course of Parkinson Disease. It is made up of the following sections:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        I. Mentation, behavior, and mood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        II. Activities of daily living",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        III. Motor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        These are evaluated by interview. Some sections require multiple grades assigned to each extremity. A total of 199 points are possible. 199 represents the worst (total) disability, while 0 represents no disability.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        I. Mentation, behavior, and mood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        1. Intellectual impairment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild. Consistent forgetfulness with partial recollection of events and no other difficulties.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderate memory loss, with disorientation and moderate difficulty handling complex problems. Mild but definite impairment of function at home with need of occasional prompting.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severe memory loss with disorientation for time and often to place. Severe impairment in handling problems.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Severe memory loss with orientation preserved to person only. Unable to make judgments or solve problems. Requires much help with personal care. Cannot be left alone at all.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        2. Thought disorder (due to dementia or drug intoxication)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Vivid dreaming.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = \"Benign\" hallucinations with insight retained.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Occasional to frequent hallucinations or delusions; without insight; could interfere with daily activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Persistent hallucinations, delusions, or florid psychosis. Not able to care for self.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        3. Depression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Periods of sadness or guilt greater than normal, never sustained for days or weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Sustained depression (1 week or more).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Sustained depression with vegetative symptoms (insomnia, anorexia, weight loss, loss of interest).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Sustained depression with vegetative symptoms and suicidal thoughts or intent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        4. Motivation/initiative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Less assertive than usual; more passive.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Loss of initiative or disinterest in elective (nonroutine) activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Loss of initiative or disinterest in day to day (routine) activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Withdrawn, complete loss of motivation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        II. Activities of daily living (for both \"on\" and \"off\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        5. Speech",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mildly affected. No difficulty being understood.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately affected. Sometimes asked to repeat statements.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely affected. Frequently asked to repeat statements.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Unintelligible most of the time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        6. Salivation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight but definite excess of saliva in mouth; may have nighttime drooling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately excessive saliva; may have minimal drooling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Marked excess of saliva with some drooling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked drooling, requires constant tissue or handkerchief.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        7. Swallowing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Rare choking.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Occasional choking.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Requires soft food.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Requires NG tube or gastrotomy feeding.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        8. Handwriting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slightly slow or small.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately slow or small; all words are legible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely affected; not all words are legible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = The majority of words are not legible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        9. Cutting food and handling utensils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Somewhat slow and clumsy, but no help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Can cut most foods, although clumsy and slow; some help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Food must be cut by someone, but can still feed slowly.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Needs to be fed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        10. Dressing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Somewhat slow, but no help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Occasional assistance with buttoning, getting arms in sleeves.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Considerable help required, but can do some things alone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Helpless.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        11. Hygiene",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Somewhat slow, but no help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Needs help to shower or bathe; or very slow in hygienic care.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Requires assistance for washing, brushing teeth, combing hair, going to bathroom.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Foley catheter or other mechanical aids.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        12. Turning in bed and adjusting bed clothes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Somewhat slow and clumsy, but no help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Can turn alone or adjust sheets, but with great difficulty.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Can initiate, but not turn or adjust sheets alone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Helpless.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        13. Falling (unrelated to freezing)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Rare falling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Occasionally falls, less than once per day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Falls an average of once daily.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Falls more than once daily.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        14. Freezing when walking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Rare freezing when walking; may have start hesitation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Occasional freezing when walking.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Frequent freezing. Occasionally falls from freezing.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Frequent falls from freezing.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        15. Walking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild difficulty. May not swing arms or may tend to drag leg.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderate difficulty, but requires little or no assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severe disturbance of walking, requiring assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Cannot walk at all, even with assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        16. Tremor (symptomatic complaint of tremor in any part of body)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Absent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight and infrequently present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderate; bothersome to patient.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severe; interferes with many activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked; interferes with most activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        17. Sensory complaints related to parkinsonism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Occasionally has numbness, tingling, or mild aching.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Frequently has numbness, tingling, or aching; not distressing.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Frequent painful sensations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Excruciating pain.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        III. Motor examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        18. Speech",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight loss of expression, diction and/or volume.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Monotone, slurred but understandable; moderately impaired.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Marked impairment, difficult to understand.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Unintelligible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        19. Facial expression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Minimal hypomimia, could be normal \"Poker Face\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Slight but definitely abnormal diminution of facial expression.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Moderate hypomimia; lips parted some of the time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Masked or fixed facies with severe or complete loss of facial expression; lips parted 1/4 inch or more.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        20. Tremor at rest (head, upper and lower extremities)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Absent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight and infrequently present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Mild in amplitude and persistent. Or moderate in amplitude, but only intermittently present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Moderate in amplitude and present most of the time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked in amplitude and present most of the time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        21. Action or postural tremor of hands",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Absent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight; present with action.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderate in amplitude, present with action.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Moderate in amplitude with posture holding as well as action.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked in amplitude; interferes with feeding.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        22. Rigidity (judged on passive movement of major joints with patient relaxed in sitting position. Cogwheeling to be ignored).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Absent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slight or detectable only when activated by mirror or other movements.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Mild to moderate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Marked, but full range of motion easily achieved.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Severe, range of motion achieved with difficulty.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        23. Finger taps (patient taps thumb with index finger in rapid succession)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild slowing and/or reduction in amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately impaired. Definite and early fatiguing. May have occasional arrests in movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely impaired. Frequent hesitation in initiating movements or arrests in ongoing movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Can barely perform the task.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        24. Hand movements (patient opens and closes hands in rapid succession)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild slowing and/or reduction in amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately impaired. Definite and early fatiguing. May have occasional arrests in movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely impaired. Frequent hesitation in initiating movements or arrests in ongoing movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Can barely perform the task.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        25. Rapid alternating movements of hands (pronation-supination movements of hands, vertically and horizontally, with as large an amplitude as possible, both hands simultaneously)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild slowing and/or reduction in amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately impaired. Definite and early fatiguing. May have occasional arrests in movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely impaired. Frequent hesitation in initiating movements or arrests in ongoing movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Can barely perform the task.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        26. Leg agility (patient taps heel on the ground in rapid succession picking up entire leg. Amplitude should be at least 3 inches).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Mild slowing and/or reduction in amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately impaired. Definite and early fatiguing. May have occasional arrests in movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely impaired. Frequent hesitation in initiating movements or arrests in ongoing movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Can barely perform the task.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        27. Arising from chair (patient attempts to rise from a straight-backed chair, with arms folded across chest)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Slow; or may need more than one attempt.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Pushes self up from arms of seat.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Tends to fall back and may have to try more than one time, but can get up without help.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Unable to arise without help.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        28. Posture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal erect.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Not quite erect, slightly stooped posture; could be normal for older person.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Moderately stooped posture, definitely abnormal; can be slightly leaning to one side.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severely stooped posture with kyphosis; can be moderately leaning to one side.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked flexion with extreme abnormality of posture.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        29. Gait",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Walks slowly, may shuffle with short steps, but no festination (hastening steps) or propulsion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Walks with difficulty, but requires little or no assistance; may have some festination, short steps, or propulsion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Severe disturbance of gait, requiring assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Cannot walk at all, even with assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        30. Postural stability (response to sudden, strong posterior displacement produced by pull on shoulders while patient erect with eyes open and feet slightly apart. Patient is prepared).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Retropulsion, but recovers unaided.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Absence of postural response; would fall if not caught by examiner.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Very unstable, tends to lose balance spontaneously.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Unable to stand without assistance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        31. Body Bradykinesia and Hypokinesia (combining slowness, hesitancy, decreased arm swing, small amplitude, and poverty of movement in general)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 = Minimal slowness, giving movement a deliberate character; could be normal for some persons. Possibly reduced amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2 = Mild degree of slowness and poverty of movement which is definitely abnormal. Alternatively, some reduced amplitude.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 = Moderate slowness, poverty or small amplitude of movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        4 = Marked slowness, poverty or small amplitude of movement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        IV. Complications of therapy (in the past week)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        1. Dyskinesias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        32. Duration: what proportion of the waking day are dyskinesias present? (Historical information).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = 1-25 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 = 26-50 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3 = 51-75 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4 = 76-100 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        33. Disability: how disabling are the dyskinesias? (Historical information; may be modified by office examination).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = Not disabling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Mildly disabling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 = Moderately disabling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3 = Severely disabling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4 = Completely disabled.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        34. Painful dyskinesias: how painful are the dyskinesias?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No painful dyskinesias.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Slight.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 = Moderate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3 = Severe.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4 = Marked.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        35. Presence of early morning dystonia (historical information).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        2. Clinical fluctuations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        36. Are \"off\" periods predictable?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        37. Are \"off\" periods unpredictable?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        38. Do \"off\" periods come on suddenly, within a few seconds?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        39. What proportion of the waking day is the patient \"off\" on average?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = None.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = 1-25 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 = 26-50 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3 = 51-75 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4 = 76-100 percent of day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        3. Other complications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        40. Does the patient have anorexia, nausea, or vomiting?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        41. Any sleep disturbances, such as insomnia or hypersomnolence?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        42. Does the patient have symptomatic orthostasis? (Record the patient's blood pressure, height and weight on the scoring form).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        0 = No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 = Yes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        V. Modified Hoehn and Yahr staging",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 0 = No signs of disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 1 = Unilateral disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 1.5 = Unilateral plus axial involvement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 2 = Bilateral disease, without impairment of balance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 2.5 = Mild bilateral disease, with recovery on pull test.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 3 = Mild to moderate bilateral disease; some postural instability; physically independent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 4 = Severe disability; still able to walk or stand unassisted.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        STAGE 5 = Wheelchair bound or bedridden unless aided.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        VI. Schwab and England Activities of Daily Living Scale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        100 percent = Completely independent. Able to do all chores without slowness, difficulty or impairment. Essentially normal. Unaware of any difficulty.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        90 percent = Completely independent. Able to do all chores with some degree of slowness, difficulty and impairment. Might take twice as long. Beginning to be aware of difficulty.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        80 percent = Completely independent in most chores. Takes twice as long. Conscious of difficulty and slowness.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        70 percent = Not completely independent. More difficulty with some chores. Three to four times as long in some. Must spend a large part of the day with chores.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        60 percent = Some dependency. Can do most chores, but exceedingly slowly and with much effort. Errors; some impossible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        50 percent = More dependent. Help with half, slower, etc. Difficulty with everything.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        40 percent = Very dependent. Can assist with all chores, but few alone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        30 percent = With effort, now and then does a few chores alone or begins alone. Much help needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        20 percent = Nothing alone. Can be a slight help with some chores. Severe invalid.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        10 percent = Totally dependent, helpless. Complete invalid.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0 percent = Vegetative functions such as swallowing, bladder and bowel functions are not functioning. Bedridden.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Fahn S, Elton R, UPDRS Development Committee. Unified Parkinson's Disease Rating Scale In: Fahn S, Marsden CD, Calne DB, Goldstein M, eds. Recent Developments in Parkinson's Disease, Vol 2. Florham Park, NJ. Macmillan Health Care Information 1987, pp 153-163.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
