var title_f33_46_34534="Fontan stage III repair for HLHS";
var content_f33_46_34534=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F74164&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F74164&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fontan stage III repair for HLHS",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 424px; height: 572px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In stage III repair, the extracardiac Fontan uses a tube graft to connect the inferior vena cava to the central pulmonary artery, which already is connected to the superior vena cava through the stage II repair (Glenn shunt). As a result, all caval return with the exception of the coronary sinus is directed to the pulmonary arteries, simulating as closely as possible the normal circulatory pattern.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Tweddell J, Hoffman G, Ghanayem N, et al. Hypoplastic left heart syndrome. In: Moss and Adams' Heart Disease in Infants, Children and Adolescents: Including the Fetus and Young Adult, 7th, Allen H, Driscoll D, Shaddy R, et al. (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2008. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
