var title_f33_46_34539="Objective physical signs of substance abuse";
var content_f33_46_34539=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F55487&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F55487&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Objective physical signs to look for in substance abusers",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Body system",
"      </td>",
"      <td class=\"subtitle1\">",
"       Findings",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Dermatologic",
"      </td>",
"      <td>",
"       Abscesses, rashes, cellulitis, thrombosed veins, jaundice, scars, track marks, pock marks from skin popping",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ear, nose, and throat",
"      </td>",
"      <td>",
"       Pupils pinpoint or dilated, yellow sclera, conjunctivitis ruptured eardrums, otitis media, discharge from ears, rhinorrhea, rhinitis, excoriation or perforation of nasal septum, epistaxis, sinusitis, hoarseness or laryngitis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mouth",
"      </td>",
"      <td>",
"       Poor dentition, gum disease, abscesses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cardiovascular",
"      </td>",
"      <td>",
"       Murmurs, arrhythmias",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Respiratory",
"      </td>",
"      <td>",
"       Asthma, dyspnea, rales, chronic cough, hematemesis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Musculoskeletal &amp; extremities",
"      </td>",
"      <td>",
"       Pitting edema, broken bones, traumatic amputations, burns on fingers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Gastrointestinal",
"      </td>",
"      <td>",
"       Hepatomegaly, hernias",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Chest/breasts",
"      </td>",
"      <td>",
"       Lumps, abscesses, scars, track marks in mammary vessels, enlarged lymph nodes in axilla",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pelvic exam",
"      </td>",
"      <td>",
"       Assess uterus, cervix, cesarean delivery scars, labial tears or rectal contusions, sexually transmitted infections",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
