var script_f33_46_34541=[""].join("\n");
var outline_f33_46_34541=null;
var title_f33_46_34542="Predisposing factors and clinical aspects of infectious syndrome";
var content_f33_46_34542=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F79173&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F79173&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Predisposing factors and clinical aspects of infectious syndromes in older adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Predisposition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pertinent considerations in older adults",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Bacteremia and sepsis",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Comorbidities",
"         </li>",
"         <li>",
"          Poor immune function",
"         </li>",
"         <li>",
"          Thin/dry mucosa",
"         </li>",
"         <li>",
"          Vascular grafts/prosthetic devices",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Greater incidence of urinary or gastrointestinal source increases risk of gram-negatives organisms, particularly in oldest-old.",
"         </li>",
"         <li>",
"          Aggressive therapies, including use of activated protein C, effective even in those over 75 years.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Bone and joint infection",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Prosthetic devices",
"         </li>",
"         <li>",
"          Peripheral neuropathy",
"         </li>",
"         <li>",
"          Peripheral vascular disease",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Preservation of functional status paramount concern and may alter approach to therapy.",
"         </li>",
"         <li>",
"          Insurance coverage (Medicare) for outpatient antibiotic costs may be limited and necessitate LTC stay.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Fever of unknown origin (FUO)",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Age-related increases in",
"          <em>",
"           M. tuberculosis",
"          </em>",
"         </li>",
"         <li>",
"          Cancer risk",
"         </li>",
"         <li>",
"          Degenerative valve disease",
"         </li>",
"         <li>",
"          Collagen vascular diseases of aging (eg, giant cell arteritis)",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Increased rates of tuberculosis, infective endocarditis and abdominal as cause of FUO.",
"         </li>",
"         <li>",
"          Elevated ESR and alkaline phosphatase increase pretest probability of positive biopsy for giant cell arteritis but relatively low threshold for biopsy should be maintained.",
"         </li>",
"         <li>",
"          Lymphoma most likely neoplasm.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Fever in hospitalized patients",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          More procedures",
"         </li>",
"         <li>",
"          More indwelling devices/catheters",
"         </li>",
"         <li>",
"          Poor bowel/bladder function",
"         </li>",
"         <li>",
"          Pressure ulcers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Infection accounts for 3/4 of all nosocomial febrile episodes.",
"         </li>",
"         <li>",
"          Consider noninfectious causes: venous thrombosis, drug reactions, MI.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Food-borne illness, and intra-abdominal infections",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Achlorhydria",
"         </li>",
"         <li>",
"          Poor immunity versus intra-cellular bacteria (",
"          <em>",
"           Salmonella",
"          </em>",
"          and",
"          <em>",
"           Listeria",
"          </em>",
"          spp)",
"         </li>",
"         <li>",
"          Mesenteric peripheral vascular disease",
"         </li>",
"         <li>",
"          Diverticular disease",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Higher incidence of diverticulitis, bowel obstruction and mesenteric ischemia/bowel infarction in the elderly.",
"         </li>",
"         <li>",
"          Greater risk of mortality with appendicitis due to poor recognition of the syndrome.",
"         </li>",
"         <li>",
"          Consider",
"          <em>",
"           C difficile",
"          </em>",
"          colitis in patients with diarrhea and recent antimicrobial therapy or institutionalized.",
"         </li>",
"         <li>",
"          Infection control important to prevent spread",
"          <em>",
"           C difficile",
"          </em>",
"          .",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         HIV infection/AIDS",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Don't perceive HIV as a threat",
"         </li>",
"         <li>",
"          Poor awareness of STDs",
"         </li>",
"         <li>",
"          No need for pregnancy prevention",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          More likely to present already AIDS-defined.",
"         </li>",
"         <li>",
"          Untreated, HIV progresses more rapidly, but response to combined anti-retroviral therapy similar.",
"         </li>",
"         <li>",
"          Concerns re atherosclerosis and bone loss due to HIV or its treatment.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Infective endocarditis",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Degenerative/calcified valvular disease",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Clinical manifestations frequently subtle. TTE less sensitive than in young adults due to valve calcification/degeneration.",
"         </li>",
"         <li>",
"          Microbiology and therapy similar but increased adverse drug effects (eg, aminoglycoside-induced nephrotoxicity).",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Influenza",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Institutionalization",
"         </li>",
"         <li>",
"          Comorbidities increase the risk of morbidity and mortality",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Often exacerbates underlying illness, resulting in hospitalization or death.",
"         </li>",
"         <li>",
"          Early therapy (&lt;24 hours after onset) may reduce hospitalization and need for antibiotics due to bacterial superinfection.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Meningitis",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Increased risk of bacteremia",
"         </li>",
"         <li>",
"          Poor clearance of encapsulated organisms",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          S. pneumoniae remains most likely organism.",
"         </li>",
"         <li>",
"          Gram negative bacilli,",
"          <em>",
"           Listeria monocytogenes",
"          </em>",
"          ,",
"          <em>",
"           M. tuberculosis",
"          </em>",
"          are more common than in younger adults.",
"         </li>",
"         <li>",
"          Treatment similar to that of young adults.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Ocular infection",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Dry eyes prevalent",
"         </li>",
"         <li>",
"          Common reactivation of herpes viruses",
"         </li>",
"         <li>",
"          Cataract surgery and implants",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Increased likelihood of viral keratitis (usually due to HSV) and ocular complications of herpes zoster.",
"         </li>",
"         <li>",
"          Endophthalmitis may be associated with cataract surgery/implants.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Pneumonia",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Comorbid disease (eg, COPD)",
"         </li>",
"         <li>",
"          Stroke and swallowing abnormalities",
"         </li>",
"         <li>",
"          Poor immunity to encapsulated organisms",
"         </li>",
"         <li>",
"          Increased severity of viral illnesses",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Rate and severity of illness increases with far advanced age (&gt;85 yrs), comorbidities and long-term care residence.",
"         </li>",
"         <li>",
"          Clinical manifestations often subtle.",
"         </li>",
"         <li>",
"          Microbiology more often polymicrobial or TB.",
"         </li>",
"         <li>",
"          Broader antibiotic coverage needed for aspiration, LTC residence and in some co-morbid illnesses (eg, severe COPD).",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Skin/soft tissue",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Dry/thin skin",
"         </li>",
"         <li>",
"          Poor cell-mediated immunity",
"         </li>",
"         <li>",
"          Reactivation of herpes viruses",
"         </li>",
"         <li>",
"          Poor mobility/pressure ulcers",
"         </li>",
"         <li>",
"          Comorbidities (eg, diabetes mellitus, chronic edema, peripheral vascular disease)",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Zoster and PHN occur more frequently.",
"         </li>",
"         <li>",
"          Immunization reduces risk of zoster and PHN.",
"         </li>",
"         <li>",
"          Aggressive skin/soft tissue infections (eg, necrotizing fasciitis, malignant otitis externa, Fornier's gangrene) more common, particularly with co-morbidities (eg, diabetes and chronic edema).",
"         </li>",
"         <li>",
"          Antibiotic resistance more common with prior therapy and/or long-term care residence.",
"         </li>",
"         <li>",
"          If chronic edema and recurrent cellulitis, look for onychomycosis as source of entry.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Urinary tract infection",
"        </strong>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Incomplete bladder emptying due to detrusor dysfunction or obstruction (eg, BPH)",
"         </li>",
"         <li>",
"          Comorbidity",
"         </li>",
"         <li>",
"          Indwelling or condom catheters",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Asymptomatic bacteriuria does not require treatment; occurs in 10 to 15 percent of community-dwelling elderly, and up to 50 percent of LTC residents.",
"         </li>",
"         <li>",
"          Clinical manifestations of true UTI often subtle (eg, change in functional status).",
"         </li>",
"         <li>",
"          <em>",
"           E. coli",
"          </em>",
"          and other gram-negative bacilli still most likely, but more enterococci and",
"          <em>",
"           S. agglactiae",
"          </em>",
"          than in younger adults.",
"         </li>",
"         <li>",
"          Prevention aimed at alleviating obstruction, increasing bladder emptying, and reducing in-dwelling catheter use.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     BPH: benign prostatic hyperplasia; COPD: chronic obstructive pulmonary disease; ESR: erythrocyte sedimentation rate; FUO: fever of unknown origin; LTC: long-term care; MI: myocardial infarction; PHN: postherpetic neuralgia; STD: sexually transmitted disease; TB: tuberculosis; TTE: transthoracic echocardiogram; UTI: urinary tract infection.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
