var title_f33_46_34543="Trochanteric bursa injection in children";
var content_f33_46_34543=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F72665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F72665&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Trochanteric bursa injection in children",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 327px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Trochanteric bursa injection, which may be multiple, not single as shown, may be made up of triamcinolone acetonide (1 mg/kg of 40 mg/mL suspension, maximum 40 mg) mixed with lidocaine without epinephrine (maximum 4.5 mg/kg, not to exceed 300 mg). After localizing the points of maximum tenderness by deep palpation, a 1.5- to 4-inch needle is used as a probe and the points of maximum tenderness are determined. The injection should be done by redirecting several places within the same coronal plane close to bone. The operator should not wander off the coronal plane of the maximal bony protuberance in order to be absolutely sure of avoiding neurovascular structures.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Owen DS. Aspiration and injection of joints in soft tissue. In: Textbook of Rheumatology, 4th edition, Kelley WN, Harris ED Jr, Ruddy S, et al (Eds), WB Saunders, Philadelphia, 1993. p.545.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
